```octave
function median_of_integers
  n = 27;
  S = 3^7;

  % Solve for a and l
  a = (2*S/n - 1)/2;
  l = (2*S/n + 1)/2;

  % Calculate the median
  median = (a + l)/2;

  return median;
end

result = median_of_integers();
disp(result);
```
