```octave
function area_abc
    A = [0, 0];
    B = [9, 6];
    C = [6, 12];

    area_abc = abs(A(1)*(B(2) - C(2)) + B(1)*(C(2) - A(2)) + C(1)*(A(2) - B(2))) / 2;
end

result = area_abc()
```

Similarly, the area of the triangle DEF can be calculated as follows:

```octave
