```octave
function final_amount
  initial_amount = 1000;
  annual_interest_rate = 7.5 / 100;
  compounding_periods_per_year = 4;
  years = 2;

  # Calculate the total number of compounding periods
  total_compounding_periods = compounding_periods_per_year * years;

  # Calculate the interest rate per compounding period
  interest_rate_per_period = annual_interest_rate / compounding_periods_per_year;

  # Calculate the final amount using the compound interest formula
  final_amount = initial_amount * (1 + interest_rate_per_period)^total_compounding_periods;

  return final_amount;
end

result = final_amount();
printf("%.0f\n", result);
```
