AB = sqrt(AD^2 + BD^2)

We know that the volume of the pyramid is 63,960 cubic meters and the height is 30 meters. We can use these values to calculate the area of the base (s^2) and then find the length of the base (s). 

Once we have the length of the base, we can find the length of BD (half the base). Then we can use the Pythagorean theorem to find the length of AB.

Here is a sample Octave code to solve this problem:

```octave
function lateral_height
    volume = 63960;
    height = 30;

    # Calculate the area of the base
    base_area = volume * 3 / height;

    # Calculate the length of the base
    base_length = sqrt(base_area);

    # Calculate the length of BD (half the base)
    bd_length = base_length / 2;

    # Calculate the length of AB using the Pythagorean theorem
    ab_length = sqrt(height^2 + bd_length^2);

    # Round the result to the nearest whole number
    ab_length_rounded = round(ab_length);

    return ab_length_rounded;
end

result = lateral_height();
disp(result);
```
