    semi_axes = [sqrt(3), sqrt(2)];

    % Maximum x-coordinate is the center x-coordinate plus the semi-axis in the x-direction
    max_x = center(1) + semi_axes(1);

    return max_x;
end

result = max_x_coordinate();
