Here is the Octave code to calculate the number of ways:

```octave
function ways = calculate_ways()
  total_balls = 12;
  draw_balls = 3;

  ways = nchoosek(total_balls, draw_balls) * factorial(total_balls - draw_balls) / factorial(total_balls - draw_balls - 1);
end

result = calculate_ways();
disp(result);
```
